from customtkinter import CTk, CTkToplevel, CTkLabel, CTkEntry, CTkFrame, StringVar
from typing import Union, Tuple, List
from types import SimpleNamespace
from tkinterdnd2.TkinterDnD import Tk
from tkinter.ttk import Treeview, Style
from screeninfo import get_monitors
from nyeda.features.encdec import base64tools
from nyeda.types.abc import Feature
from PIL.ImageTk import PhotoImage
from PIL.Image import open as openimage
from io import BytesIO as frombytes
from nyeda.exceptions import NYEDAException, NYEDASEG
from pathlib import Path

icons = SimpleNamespace(
    topsecret = __topsecret__,
    folder = __folder__,
    passcode = __passkeypopupicon__,
    segment = __segmenticon__,
    file = __fileicon__,
)

class mastertools(Feature):
    HEIGHT: int = get_monitors()[0].height
    WIDTH: int = get_monitors()[0].width
    __master__: Union[CTk, Tk]
    __toplevel__: CTkToplevel
    __mastericon__: PhotoImage
    __toplevelicon__: PhotoImage
    @staticmethod
    def generate_master(*args, **kwargs) -> CTk:
        return CTk(*args, **kwargs)
    @staticmethod
    def generate_dnd_master(*args, **kwargs) -> Tk:
        return Tk(*args, **kwargs)
    @staticmethod
    def generate_toplevel(*args, **kwargs) -> CTkToplevel:
        return CTkToplevel(*args, **kwargs)
    @staticmethod
    def centralgeometry(width: int, height: int) -> str:
        if not isinstance(width, int) or not isinstance(height, int):
            return NYEDASEG(NYEDAException, 'width and height must be integer! (via. centralgeometry)')
        return "{}x{}+{}+{}".format(width, height, (mastertools.WIDTH - width) // 2, (mastertools.HEIGHT - height) // 2)
    
    def __quitmaster__(self, event=None, /) -> None:
        for aid in self.__master__.tk.call('after', 'info'):
            self.__master__.after_cancel(aid)
        self.__master__.update()
        self.__master__.quit()
    
    def __toplevelexitprotocol__(self, event=None, /) -> None:
        self.__toplevel__.destroy()
        self.__master__.iconphoto(False, self.__mastericon__)
        self.__master__.attributes('-topmost', True)
        self.__master__.focus_force()
        self.__master__.update()

    def __toplevelmainloop__(self, event=None, /) -> None:
        self.__toplevel__.grab_set()
        self.__master__.wait_window(self.__toplevel__)
    
    def __mastersetup__(self, title: str, icon: bytes, geometry: Tuple[int, int], resizable: bool) -> None:
        self.__master__.title(title)
        self.__mastericon__ = PhotoImage(openimage(frombytes(base64tools.decode(icon))))
        self.__master__.iconphoto(False, self.__mastericon__)
        self.__master__.geometry(self.centralgeometry(*geometry))
        self.__master__.resizable(resizable, resizable)
        self.__master__.minsize(*geometry)
        self.__master__.maxsize(*geometry)
        self.__master__.attributes('-topmost', True)
        self.__master__.focus_set()
    
    def __toplevelsetup__(self, title: str, icon: bytes, geometry: Tuple[int, int], resizable: bool) -> None:
        self.__master__.attributes('-topmost', False)
        self.__toplevel__.attributes('-topmost', True)
        self.__toplevelicon__ = PhotoImage(openimage(frombytes(base64tools.decode(icon))))
        self.__toplevel__.iconphoto(False, self.__toplevelicon__)
        self.__toplevel__.geometry(self.centralgeometry(*geometry))
        self.__toplevel__.resizable(resizable, resizable)
        self.__toplevel__.minsize(*geometry)
        self.__toplevel__.maxsize(*geometry)
        self.__toplevel__.title(title)
        self.__toplevel__.focus_set()

class popup(mastertools, Feature):
    def getpasscode(self, title: str, icon: PhotoImage, geometry: Tuple[int, int], resizable: bool, withdraw: bool = False, show: str = "#", standalone: bool = False) -> bytes:
        # if __master__ is present in the context, then create a toplevel
        # over it
        __mainloop__: bool = False
        if hasattr(self, '__master__'):
            if withdraw is True:
                self.__master__.withdraw()
                self.__master__.update()
            self.__toplevel__ = self.generate_toplevel()
        else: # else create a master and use to to create toplevel
            __mainloop__ = True # mainloop needed to run.
            self.__master__ = self.generate_master()
            if withdraw is True:
                self.__master__.withdraw()
                self.__master__.update()
            self.__toplevel__ = self.generate_toplevel(self.__master__)
        
        # set the icon photo of __master__ if not present to avoid glitch
        # in the exit protocol
        if not hasattr(self, '__mastericon__'):
            self.__mastericon__ = PhotoImage(openimage(frombytes(base64tools.decode(icon))))
            self.__master__.iconphoto(False, self.__mastericon__)
        
        # setup toplevel based on parameters given
        self.__toplevelsetup__(title, icon, geometry, resizable)

        # create a string variable for getting input from user.
        self.__passcodevar__ = StringVar(self.__toplevel__, value='')

        # create a label for passcode
        self.__passcodelabel__ = CTkLabel(self.__toplevel__, text='password:')

        # create an entry for passcode
        self.__passcodeentry__ = CTkEntry(self.__toplevel__, width=150, textvariable=self.__passcodevar__)

        # if show is not ''
        if show != '':
            self.__passcodeentry__.configure(show=show)
        
        # place the widgets in the toplevel
        self.__passcodelabel__.place(relx=0.2, rely=0.5, anchor='center')
        self.__passcodeentry__.place(relx=0.64, rely=0.5, anchor='center')

        # focus into the entry widget
        self.__passcodeentry__.focus_set()

        # Bind the enter key to the FocusIn and Out
        self.__passcodeentry__.bind('<FocusIn>', lambda e: self.__passcodeentry__.bind('<Return>', self.__toplevelexitprotocol__))
        self.__passcodeentry__.bind('<FocusOut>', self.__passcodeentry__.unbind('<Return>'))

        # set the top level exit protocol
        self.__toplevel__.protocol('WM_DELETE_WINDOW', self.__toplevelexitprotocol__)

        # set the master exit protocol, if master was not present
        if __mainloop__ is True:
            self.__master__.protocol('WM_DELETE_WINDOW', self.__quitmaster__)

        # run the top level mainloop helper
        self.__toplevelmainloop__(None)

        # run the master mainloop if needed
        if __mainloop__ is True:
            self.__master__.mainloop()

        # return whatever the value of passcode var is (regardless of it
        # being empty).
        return base64tools.encode(self.__passcodevar__.get().encode())

class FilesystemTree(Treeview):
    def __init__(self, *args, **kwargs) -> None:
        super().__init__(*args, **kwargs)

        # load all icon images as Photoimages
        self.__filetype__ = PhotoImage(openimage(frombytes(base64tools.decode(__fileicon__))).resize((19, 18)))
        self.__foldertype__ = PhotoImage(openimage(frombytes(base64tools.decode(__folder__))).resize((19, 18)))
        self.__archivetype__ = PhotoImage(openimage(frombytes(base64tools.decode(__topsecret__))).resize((19, 18)))

        # Create custom style
        style = Style()
        style.configure("Treeview", font=("Fira Code", 13))
        style.configure("Treeview.Heading", font=('', 14, 'italic'))

class DropFrame(CTkFrame):
    __filesystem__: List[Path] = []
    def __init__(self, master, *args, **kwargs) -> None:
        super().__init__(master, *args, **kwargs)

        # Create a central label
        self.__labeltext__ = "Drag and drop folders"
        self.__labeltextcolor__ = 'gray60'
        self.__label__ = CTkLabel(
            self,
            text=self.__labeltext__,
            text_color=self.__labeltextcolor__,
        )
        self.__labelplacement__ = {'relx': 0.5, 'rely': 0.5, 'anchor': 'center'}
        self.__label__.place(**self.__labelplacement__)
        self.__labelfgcolor__ = self._fg_color
    
    def __dndenter__(self, event=None, /) -> None:
        self.configure(fg_color=('gray75', 'gray35'))
    
    def __dndexit__(self, event=None, /) -> None:
        self.configure(fg_color=self.__labelfgcolor__)
    
    def __ondrop__(self, event=None, /) -> None:
        __path__ = Path(event.data.strip('{}'))

        if __path__.is_dir():
            if hasattr(self, '__drophandle__'):
                self.__drophandle__(__path__)
        else:
            self.__label__.configure(text='Only folders can be dropped here!', text_color='red')
            self.__label__.after(2000, self.__label__.configure(text=self.__labeltext__, text_color=self.__labeltextcolor__))
        
        self.__dndexit__(event)
        self.master.focus_force()
    
    def set_drophandle(self, func) -> None:
        self.__drophandle__ = func